DROP TABLE IF EXISTS product;
CREATE TABLE IF NOT EXISTS product(
   item_id             INTEGER  NOT NULL PRIMARY KEY 
  ,item_url            VARCHAR(229) NOT NULL
  ,item_brand_name     VARCHAR(13)
  ,item_price          INTEGER  NOT NULL
  ,item_tikinow        VARCHAR(5)
  ,item_discount_rate  INTEGER  NOT NULL
  ,item_rating_average NUMERIC(3,1) NOT NULL
  ,item_review_count   INTEGER  NOT NULL
  ,item_quantity       INTEGER  NOT NULL
);
